#include <iostream>
#include <vector>

int main() {
	long sievesize;
	std::cin >> sievesize;
	std::vector<long> sieve(sievesize, 1);
	for (long i = 2; (i * i) < sievesize; i++) {
		if (sieve[i]) {
			for (long j = i + i; j < sievesize; j += i) {
				sieve[j] = 0;
			}
		}
	}
	long kazu = 0;
	for (long i = 0; i < long(sieve.size()); i++) {
		if (int(sieve.at(i)) == 0) {
			kazu++;
		}
	}
	std::cout << kazu << std::endl;
}
